import React from 'react';
import {Route} from 'react-router-dom';
import MovieList from './components/MovieList';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <Route path="/" component={MovieList} />
    </div>
  );
}

export default App;
